import React, { Component } from "react";
import axios from "axios";
import API from "../utils/API";
import ReactPlayer from "react-player";
import { Container, TextField, Typography, Grid } from "@material-ui/core";

class MySessions extends Component {
  state = {
    sessions: []
  };

  componentDidMount() {
    API.getSessions("brody@mac.com")
      .then(res => {
        console.log(res.data);
        this.setState({ sessions: res.data.sessions });
        console.log(this.state.sessions);
      })
      .catch(err => console.log(err));
  }

  render() {
    return (
      <div>
        {this.state.sessions.map(session => (
          <Container maxWidth="md" justify="center" alignContent="center">
          <ReactPlayer url={session.videoURL} />
          </Container>
        ))}
      </div>
    );
  }
}

export default MySessions;
